import './Navbar.css';
export default function Navbar() {
    return (
       
             <nav>
                <ul className='liste'>
                    <li className='items'>Accueil</li>
                    <li className='items' >Services</li>
                    <li className='items' >FFFFF</li>
                    <button className='btn'>btn Menu</button>  
                </ul>
                          
            </nav>
        
    )
}
